import NavBar from "./components/NavBar/Navbar"
import {Route, BrowserRouter, NavLink} from "react-router-dom";

const App = () => {
  return (
      <BrowserRouter>
        <div className={s.App}>
            <div className={s.logo}>
                <h3>logo</h3>
            </div>
            <div navbar>
            <h3 className={s.link}> Link1 </h3>
            <h3 className={s.link}> Link2 </h3>
            <h3 className={s.link}> Link3 </h3>
            </div>
        </div>
      </BrowserRouter>
  );
}

export default App;
